import React, { useState } from "react";
import { TodoForm } from "./TodoForm";

export const TodoWrapper = () => {
  const [todos, setTodos] = useState([]);

  const addTodo = (todo) => {
    {
      setTodos([
        ...todos,
        {
          id: uuid4(),
          task: todo,
          completed: false,
          isEditing: false,
        },
      ]);
    }
  };

  return (
    <div className="TodoWrapper">
      <TodoForm addTodo={addTodo} />{" "}
    </div>
  );
};
